import React from 'react'

function Card() {
  return (
    <div className='Card'>
      <Swiper
        onSwiper={setSwiperRef}
        slidesPerView={6}
        spaceBetween={30}
        pagination={{
          type: 'fraction',
        }}
        navigation={true}
        modules={[Pagination, Navigation]}
        className="mySwiper2"
      >
        <SwiperSlide className="cardInfo">Slide 1</SwiperSlide>
        <SwiperSlide className="cardInfo">Slide 2</SwiperSlide>
        <SwiperSlide>Slide 3</SwiperSlide>
        <SwiperSlide>Slide 4</SwiperSlide>
        <SwiperSlide>Slide 4</SwiperSlide>
        <SwiperSlide>Slide 4</SwiperSlide>
        <SwiperSlide>Slide 4</SwiperSlide>
        <SwiperSlide>Slide 4</SwiperSlide>
      </Swiper>
      <h3>Titanic</h3>
    </div>
  )
}

export default Card
